import React from "react";

class Area extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      areas: [
        { id: 0, title: "서울", area: "서울" },
        { id: 1, title: "경기", area: "경기" },
        { id: 2, title: "인천", area: "인천" },
        { id: 3, title: "강원", area: "강원" },
      ],
    };
  }

  render() {
    return (
      <div>
        <ol>{this.areas}</ol>
      </div>
    );
  }
}

export default Area;
